INSERT INTO `雇员` VALUES ('1', '张', '颖', '销售代表', '女士', '1968-12-08 00:00:00', '1992-05-01 00:00:00', '复兴门 245 号', '北京', '华北', '100098', '中国', '(010) 65559857', '5467', 'EMPID1.BMP', '获北京大学心理学学士学位。她同时完成了“冷食的艺术”。张颖是国际美食协会的会员。', '2');
INSERT INTO `雇员` VALUES ('2', '王', '伟', '副总裁(销售)', '博士', '1962-02-19 00:00:00', '1992-08-14 00:00:00', '罗马花园 890 号', '北京', '华北', '109801', '中国', '(010) 65559482', '3457', 'EMPID2.BMP', '王伟获南京大学商业学士学位，获该校国际营销博士学位。他能说流利的法语和意大利语并能阅读德语。他加入公司时是销售代表，被提拔为销售经理并升任销售副总裁。王伟是销售管理圆桌协会，北京商业总会和太平洋周边进口协会的成员。', null);
INSERT INTO `雇员` VALUES ('3', '李', '芳', '销售代表', '女士', '1973-08-30 00:00:00', '1992-04-01 00:00:00', '芍药园小区 78 号', '北京', '华北', '198033', '中国', '(010) 65553412', '3355', 'EMPID3.BMP', '李芳获北京学院化学学士学位。她同时完成了食品零售管理资格程序。李芳被雇用为销售员并提升为销售代表。', '2');
INSERT INTO `雇员` VALUES ('4', '郑', '建杰', '销售代表', '先生', '1968-09-19 00:00:00', '1993-05-03 00:00:00', '前门大街 789 号', '北京', '华北', '198052', '中国', '(010) 65558122', '5176', 'EMPID4.BMP', '郑建杰持有外国语学院英国文学学士学位和中国烹调艺术学院硕士学位。在他返回到北京的永久职位之前被临时派往上海办公室工作。', '2');
INSERT INTO `雇员` VALUES ('5', '赵', '军', '销售经理', '先生', '1965-03-04 00:00:00', '1993-10-17 00:00:00', '学院路 78 号', '北京', '华北', '100090', '中国', '(010) 65554848', '3453', 'EMPID5.BMP', '赵军毕业于复旦大学，获学士学位。自从加入公司成为一名销售代表，他花了6个月时间在北京办公室进行适应性工作，然后回到他在上海的固定职位。他被提拔为销售经理。赵军先生完成了课程“成功的电话销售”和“国际销售管理”。他的法语非常流利。', '2');
INSERT INTO `雇员` VALUES ('6', '孙', '林', '销售代表', '先生', '1967-07-02 00:00:00', '1993-10-17 00:00:00', '阜外大街 110 号', '北京', '华北', '100678', '中国', '(010) 65557773', '428', 'EMPID6.BMP', '孙林是交通大学（经济学硕士）和北京的清华大学的研究生（工商管理硕士）。他同时完成了课程“多元文化销售”和“销售专业人员时间管理”。他日语流利并能读写法语、葡萄牙语和西班牙语。', '5');
INSERT INTO `雇员` VALUES ('7', '金', '士鹏', '销售代表', '先生', '1960-05-29 00:00:00', '1994-01-02 00:00:00', '成府路 119 号', '北京', '华北', '100345', '中国', '(010) 65555598', '465', 'EMPID7.BMP', '金士鹏在完成他在交通大学的英语学位之前服务于和平公司并旅行了很多地方。此后他加入本公司。完成“在华北销售”的课程之后，他被调到上海办公室。', '5');
INSERT INTO `雇员` VALUES ('8', '刘', '英玫', '内部销售协调员', '女士', '1969-01-09 00:00:00', '1994-03-05 00:00:00', '建国门 76 号', '北京', '华北', '198105', '中国', '(010) 65551189', '2344', 'EMPID8.BMP', '刘英枚获得北京大学心理学学士学位。她同时完成了一门商务法语课程。她能读写法语。', '2');
INSERT INTO `雇员` VALUES ('9', '张', '雪眉', '销售代表', '女士', '1969-07-02 00:00:00', '1994-11-15 00:00:00', '永安路 678 号', '北京', '华北', '100056', '中国', '(010) 65554444', '452', 'EMPID9.BMP', '张雪眉获得科技大学英语学士学位。她的法语和德语都很流利。', '5');
